import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";

const Dashboard = ({ isDarkMode, toggleDarkMode }) => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        minHeight: "100vh",
        backgroundColor: isDarkMode ? "#121212" : "#081E0B", // very dark green
        transition: "all 0.3s",
      }}
    >
      {/* ---------- NAVBAR ---------- */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={true}
        navbarStyle={{
          backgroundColor: isDarkMode ? "#1A1A1A" : "#0B3D02", // dark green
          color: "white",
          boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
        }}
      />

      <div style={{ display: "flex" }}>
        {/* ---------- SIDEBAR ---------- */}
        <div
          style={{
            width: sidebarOpen ? "220px" : "40px",
            backgroundColor: isDarkMode ? "#1E1E1E" : "#06400F", // darker green
            color: "white",
            transition: "width 0.3s",
            padding: "20px 10px",
            display: "flex",
            flexDirection: "column",
            alignItems: sidebarOpen ? "flex-start" : "center",
            borderRight: isDarkMode ? "1px solid #333" : "1px solid #0B3D02",
            minHeight: "calc(100vh - 60px)",
          }}
        >
          <button
            onClick={toggleSidebar}
            style={{
              backgroundColor: sidebarOpen ? "#0B3D02" : isDarkMode ? "#333" : "#0B3D02",
              color: "white",
              border: "none",
              padding: "8px",
              borderRadius: "5px",
              cursor: "pointer",
              marginBottom: "20px",
              width: sidebarOpen ? "100%" : "35px",
              transition: "all 0.3s",
            }}
          >
            {sidebarOpen ? "Close" : "≡"}
          </button>

          {sidebarOpen && (
            <div style={{ marginTop: "20px", fontSize: "14px" }}>
              <div style={{ marginBottom: "15px", fontWeight: "bold" }}>Profile</div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Name:</strong> John Doe
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Email:</strong> john.doe@example.com
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Role:</strong> Student
              </div>
            </div>
          )}
        </div>

        {/* ---------- MAIN CONTENT ---------- */}
        <div style={{ flex: 1, padding: "30px", color: "#E0F2E9" }}>
          <h2>Dashboard</h2>
          <p>Welcome to your dashboard! Track your exams, scores, and progress.</p>

          {/* ---------- Summary Cards ---------- */}
          <div style={{ display: "flex", gap: "20px", marginTop: "20px" }}>
            {[
              { title: "Total Exams", value: 12 },
              { title: "Exams Attempted", value: 10 },
              { title: "Average Marks", value: "78%" },
            ].map((card, idx) => (
              <div
                key={idx}
                style={{
                  flex: 1,
                  backgroundColor: "#0B3D02",
                  padding: "20px",
                  borderRadius: "10px",
                  boxShadow: "0 2px 6px rgba(0,0,0,0.3)",
                  textAlign: "center",
                }}
              >
                <div style={{ fontSize: "18px", fontWeight: "bold" }}>{card.title}</div>
                <div style={{ fontSize: "28px", marginTop: "10px" }}>{card.value}</div>
              </div>
            ))}
          </div>

          {/* ---------- Progress Bars / Charts ---------- */}
          <div style={{ marginTop: "40px" }}>
            <h3>Category Performance</h3>
            {[
              { category: "Quantitative", progress: 70 },
              { category: "Reasoning", progress: 80 },
              { category: "Verbal", progress: 65 },
            ].map((item, idx) => (
              <div key={idx} style={{ marginBottom: "15px" }}>
                <div>{item.category}</div>
                <div
                  style={{
                    width: "100%",
                    height: "15px",
                    backgroundColor: "#06400F",
                    borderRadius: "10px",
                    overflow: "hidden",
                  }}
                >
                  <div
                    style={{
                      width: `${item.progress}%`,
                      height: "100%",
                      backgroundColor: "#0B3D02",
                      borderRadius: "10px",
                      transition: "width 0.5s",
                    }}
                  ></div>
                </div>
              </div>
            ))}
          </div>

          {/* ---------- Leaderboard ---------- */}
          <div style={{ marginTop: "40px" }}>
            <h3>Leaderboard</h3>
            <table
              style={{
                width: "100%",
                borderCollapse: "collapse",
                color: "#E0F2E9",
              }}
            >
              <thead>
                <tr>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Rank</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Name</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Score</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Position</th>
                </tr>
              </thead>
              <tbody>
                {[
                  { rank: 1, name: "Alice", score: "95%", position: "Top" },
                  { rank: 2, name: "Bob", score: "90%", position: "Top" },
                  { rank: 3, name: "Charlie", score: "85%", position: "Top" },
                ].map((user, idx) => (
                  <tr key={idx}>
                    <td style={{ padding: "10px" }}>{user.rank}</td>
                    <td style={{ padding: "10px" }}>{user.name}</td>
                    <td style={{ padding: "10px" }}>{user.score}</td>
                    <td style={{ padding: "10px" }}>{user.position}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          {/* ---------- Past Records ---------- */}
          <div style={{ marginTop: "40px" }}>
            <h3>Past Exam Records</h3>
            <table
              style={{
                width: "100%",
                borderCollapse: "collapse",
                color: "#E0F2E9",
              }}
            >
              <thead>
                <tr>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Exam Name</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Date</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Score</th>
                  <th style={{ borderBottom: "1px solid #06400F", padding: "10px" }}>Category</th>
                </tr>
              </thead>
              <tbody>
                {[
                  { name: "Mock Test 1", date: "01-10-2025", score: "80%", category: "Mixed" },
                  { name: "Mock Test 2", date: "05-10-2025", score: "75%", category: "Mixed" },
                  { name: "Mock Test 3", date: "10-10-2025", score: "82%", category: "Mixed" },
                ].map((record, idx) => (
                  <tr key={idx}>
                    <td style={{ padding: "10px" }}>{record.name}</td>
                    <td style={{ padding: "10px" }}>{record.date}</td>
                    <td style={{ padding: "10px" }}>{record.score}</td>
                    <td style={{ padding: "10px" }}>{record.category}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default Dashboard;
